                            <pre id="col_1-freq-value-list"
                                data-copy-text="[&#34;This medium-bodied Chardonnay is plump without being heavy, featuring modest citrus aromas but greater depth of fruit on the palate, adding pear and melon flavors to the mix. It&#39;s fresh and lively on the finish, which should serve it well with a wide variety of dishes. Drink now2013.&#34;, &#39;This is a fun wine, with flavors like cherry candy and milk chocolate. Light and insubstantial, but it will be quite nice chilled as an apritif.&#39;, &#34;The bouquet enters into the land of exotic, with aromas of sandalwood and cinnamon. But from there the wine loses steam, offering only basic plum and berry flavors followed by an earthy, almost murky finish. Doesn&#39;t show enough in the middle and late stages to rate better. Imported by American Wine Distributors.&#34;, &#39;A stewy, thick, dark Syrah with tannins akin to a plush leather chair, very savory, big in style though a tad one-dimensional. The majority of Syrah is blended with 9% Grenache and 2% Mourvdre.&#39;, &#39;An impressively ripe wine, full of Cabernet Franc trademarks, such as spice, fruitcake and red berry fruits. It is structured, firm, hinting at wood, and finishing with bright acidity.&#39;, &#39;Slightly odd-scented nose with hints of pipe tobacco, grapefruit, green apple and herbs. Better on the palate with green pear, faint apple, pineapple and herbal notes in a tart, lean framework. Pleasant hints of oak show up on the finish.&#39;, &#39;Spicy, toasty, full-bodied and fruity, this is a wine that is packed with plums, fresh red fruits, and a great burst of ripe acidity. Delicious and very accessible.&#39;, &#39;Too dark and heavy for a blush wine, with jammy flavors of cherries, vanilla and spices. Lacks lightness and intricacy.&#39;, &#34;Very simple and straightforward, this easy expression of Prosecco carries forth crisp aromas of dried grass, pressed flower, honey, peach and citrus. There&#39;s creamy foam in the mouth that would pair with mozzarella.&#34;, &#34;This wine&#39;s pungent bouquet comes close to resembling ammonia in its sweatry intensity, yet it rounds out surprisingly well on the palate, where melon fruit and a touch of sweetness emerges. Drink up.&#34;]">[&#34;This medium-bodied Chardonnay is plump without being heavy, featuring modest citrus aromas but greater depth of fruit on the palate, adding pear and melon flavors to the mix. It&#39;s fresh and lively on the finish, which should serve it well with a wide variety of dishes. Drink now2013.&#34;, &#39;This is a fun wine, with flavors like cherry candy and milk chocolate. Light and insubstantial, but it will be quite nice chilled as an apritif.&#39;, &#34;The bouquet enters into the land of exotic, with aromas of sandalwood and cinnamon. But from there the wine loses steam, offering only basic plum and berry flavors followed by an earthy, almost murky finish. Doesn&#39;t show enough in the middle and late stages to rate better. Imported by American Wine Distributors.&#34;, &#39;A stewy, thick, dark Syrah with tannins akin to a plush leather chair, very savory, big in style though a tad one-dimensional. The majority of Syrah is blended with 9% Grenache and 2% Mourvdre.&#39;, &#39;An impressively ripe wine, full of Cabernet Franc trademarks, such as spice, fruitcake and red berry fruits. It is structured, firm, hinting at wood, and finishing with bright acidity.&#39;, &#39;Slightly odd-scented nose with hints of pipe tobacco, grapefruit, green apple and herbs. Better on the palate with green pear, faint apple, pineapple and herbal notes in a tart, lean framework. Pleasant hints of oak show up on the finish.&#39;, &#39;Spicy, toasty, full-bodied and fruity, this is a wine that is packed with plums, fresh red fruits, and a great burst of ripe acidity. Delicious and very accessible.&#39;, &#39;Too dark and heavy for a blush wine, with jammy flavors of cherries, vanilla and spices. Lacks lightness and intricacy.&#39;, &#34;Very simple and straightforward, this easy expression of Prosecco carries forth crisp aromas of dried grass, pressed flower, honey, peach and citrus. There&#39;s creamy foam in the mouth that would pair with mozzarella.&#34;, &#34;This wine&#39;s pungent bouquet comes close to resembling ammonia in its sweatry intensity, yet it rounds out surprisingly well on the palate, where melon fruit and a touch of sweetness emerges. Drink up.&#34;]</pre>

